import{_ as e,c as o,o as s,b as t}from"./app.5b22e94d.js";const P=JSON.parse('{"title":"写在五月二十三上午","description":"","frontmatter":{"title":"写在五月二十三上午","date":"2020-05-23T00:00:00.000Z","draft":false,"tags":[2020]},"headers":[],"relativePath":"note/2020/20200523.md"}'),n={name:"note/2020/20200523.md"},a=t("p",null,"今天周六，还是很忙的，早上还没睡醒，就被电话叫醒，办公室装空调，让我去给工人们开下门，洗把脸，就出发，去了开始装，一个多小时，就这么过去了，中途接到消息，说服务器有高危漏洞，我需要赶紧修复，十一点过回来，然后开始修复服务器漏洞，很快就修复了中等危机的，但是三个高危是程序自带的，需要程序那边修改，使用高版本的程序，才能修复，正高兴呢，终于不用自己动手了，结果联系了半天，北京那边，连个屁也没有，微信不回，电话不接，就这么晾着，我还真是个弟弟，别人一声招呼，我就得屁颠屁颠的跑过去，这也没啥，看看时间，已经一点过两点了，我就吃了点奥利奥，喝了点水，现在也不饿了，等下午吧。",-1),_=t("p",null,"继续搞我的爬虫，昨天写的爬虫有问题，虽然能够爬下来数据，但是不完整，我怎么能够接受这种结果呢？又调试了半天，还是没找出问题，先运行看着吧，发现还是能爬下来完整的数据，只是部分不完整，而且没有被网站封，心里安慰多了，为后面的机器学习和数据分析，提供了不少的数据。",-1),c=t("p",null,"昨天发工资了，七千多，和我预料的差不多，催了好几天，才发下来，心里还是挺高兴的，起码这段时间的工作，有实际的成果了，小小算了一下，我一个月还是能存下不少的钱的。",-1),l=t("p",null,"现在让我做PPT，已经是第三次优化了，我真感觉脑袋被掏空了，而且真的不擅长做这种事情，没办法，硬着头皮上，这次有了两次经验，还是有些清晰度思路，好很多，今天无论如要做完，我不能再拖了。",-1),r=t("p",null,"我一直都有自己的小算盘，好像不务正业才是我的正业，真是奇怪，不过有充分的条件让我搞副业我倒是挺自在的，现在就是时间不够用，我的时间管理还是有问题，我得把工作一样一样最好，再来做其他副业，不能因为副业对我的诱惑，而忽视了工作。",-1),d=t("p",null,"让我想想，需要学的东西很多呀，加油！",-1),i=[a,_,c,l,r,d];function p(u,h,f,m,$,x){return s(),o("div",null,i)}const g=e(n,[["render",p]]);export{P as __pageData,g as default};
